            title: 'Initial Title',
            name: 'Initial name',
            shouldRenderTitle: false
        };
    }

    renderTitle(){
        if(!this.state.shouldRenderTitle) return null
        else if(this.state.shouldRenderTitle) return this.state.title
    }

    render(){
        return (
            <div className= "App">
                <input 
                    type="checkbox"
                    onChange={() =>this.updateCheck}
                    vaule={this.state.name} />
            </div>
        )
    }
}

